var global_fresh_item_goal;
var global_animate_frames = 64;
var global_animate_tick = 10;
/*
    柱状图更新的实际函数
 */
function fresh_handler(){
    if(global_fresh_item_goal['remain'] > 0){
        let items = document.getElementsByClassName("histogram_item");
        for(let i = 0; i < items.length; ++i){
            if(global_fresh_item_goal['items'][i] * 100 / global_animate_frames * (global_animate_frames - global_fresh_item_goal['remain']) > 0){
                items[i].style.height = global_fresh_item_goal['items'][i] * 100 / global_animate_frames * (global_animate_frames - global_fresh_item_goal['remain']) + "%"
            }
            else{
                items[i].style.height = "1px";
            }   
            
        }
        global_fresh_item_goal['remain'] -= 1;
        setTimeout(fresh_handler, global_animate_tick);
    }
}
/*
    播放一个动画,显示柱状图动态变化的过程
    items => [value_1, value_2, ...]
    数值应该要归一化 (value_1 + ... + value_n == 1)
*/
function fresh(items){
    global_fresh_item_goal = {'remain': global_animate_frames, 'items': items};
    let max = items[0], k = 0;
    for(let i = 1; i < items.length; ++i){
        if(max < items[i]){
            max = items[i];
            k = i;
        }
    }
    //调整柱状图的颜色
    let t = document.getElementsByClassName("histogram_item");
    for(let i = 0; i < t.length; ++i){
        if(i != k){
            t[i].style.cssText = t[i].style.cssText + "background-color:aqua";
        }else{
            t[i].style.cssText = t[i].style.cssText + "background-color:red";
        }
    }
    
    setTimeout(fresh_handler, global_animate_tick);
}

//创建一个空的柱状图，为后面的操作做好准备
//items => [item1, item2, ...]
function make_empty_histogram(items){
    let wrapper = document.createElement("div");
    wrapper.setAttribute("class", "Histogram_wrapper flex-d flex-row");
    count = items.length;
    for(let i = 0; i < items.length; ++i){
        let t_div = document.createElement("div");
        t_div.setAttribute("class", "histogram_item");
        t_div.style.left = i * 2 / (count * 2) * 100 + "%";
        t_div.style.width = (1 / (count * 2) * 100) + "%";
        t_div.style.height = "1px";
        t_div.style.marginLeft = 1 / (count * 2) / 2 * 100 + "%";
        t_div.style.marginRight = 1 / (count * 2) / 2 * 100 + "%";
        wrapper.appendChild(t_div);
        let p = document.createElement("p");
        p.textContent = items[i];
        p.style.left = i * 2 / (count * 2) * 100 + "%";
        p.style.marginLeft = 1 / (count * 2) / 2 * 100 + "%";
        p.style.marginRight = 1 / (count * 2) / 2 * 100 + "%";
        wrapper.appendChild(p);
    }
    return wrapper;
}

var canvas = document.getElementById("image_canvas");
var context = canvas.getContext("2d");
canvas.onmousemove = (e) => {
    if(e.buttons == 1){
        context.beginPath();
        context.arc(e.offsetX, e.offsetY, 20, 0, 2 * Math.PI, true); 
        context.closePath(); 
        context.fillStyle = 'black';
        context.fill();
    }
}
document.getElementById("image_clear").onclick = () =>{
    context.clearRect(0, 0, 500, 400);
}

document.getElementById("image_upload").onclick = () => {
    img = context.getImageData(50, 0, 400, 400);
    var tmp_canvas = document.createElement("canvas");
    var tmp_context = tmp_canvas.getContext('2d');
    tmp_context.drawImage( canvas, 0, 0, 28, 28);
    img = tmp_context.getImageData(0, 0, 28, 28);
    var data = new Array(784);
    for(var i = 0; i < 28; ++i){
        for(var j = 0; j < 28; ++j){
            data[i*28+j] = img.data[(i*img.width + j)*4 + 3] / 255;
        }
    }
    fresh(softmax(classify(data)));
}

function softmax(data){
    let out = new Array(10);
    let sum = 0;
    for(let i = 0; i < 10; ++i){
        sum = sum + Math.exp(data[i]);
    }
    for(let i = 0; i < 10; ++i){
        out[i] = Math.exp(data[i]) / sum;
    }
    return out;
}
